import React, { Component } from "react";
import { Link } from "react-router-dom";

const styles = makeStyles({
  horizontal_list: {
    display: inline
  }
});

export class Menu extends Component {
  const;
  render() {
    return (
      <div>
        Adam Pikielny
        <ul>
          <li>
            <Link to="/code">Code</Link>
          </li>
          <li>
            <Link to="/videos">Videos</Link>
          </li>
          <li>
            <Link to="/photos">Photos</Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default Menu;
